Count 3 - PTC Burglary - No contest plea.   Convicted.   State moves to dismiss and read in count 1, PTC Burglary; count 4, PTC Theft; and count 5, PTC Theft.  Motion granted.  Sentences are withheld.  Defendant is placed on probation to DOC for three (3) years.  Conditions of probation are:
1) Have no contact with Coleton Schry or the victims and their residences.
2) Pay restitution on a joint and several basis with Coleton Schry as follows:   $1,477.80 to John Kunesh; $3,968.50 to Capitol Insurance; $2,000.00 to Ken Alfson and $742.00 to Stacy Schweitzer;
3) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
4) Submit to random urine screens and pay for same;
5) Maintain absolute sobriety;
6) AODA assessment and follow through; 
7) Pay costs of action; 
8) Pay supervision fees in an amount to be determined by DOC;
9) Provide DNA sample;
10) Spend six (6) months in the county jail, under the Huber Law, to commence on 04-07-15 by 8:00 a.m.;
11) Maintain full-time employment/schooling/job search combination.
